package com.vk2.touchsreentab.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class YouTubeApiObject {    @SerializedName("data")    @Expose    private String data;    @SerializedName("error")    @Expose    private String error;    @SerializedName("message")    @Expose    private String message;    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    public String getError() {        return error;    }    public void setError(String error) {        this.error = error;    }    public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }}